/*Table structure for table `fofrsv` */

DROP TABLE IF EXISTS `fofrsv`;

CREATE TABLE `fofrsv` (
  `RsvNo` varchar(20) NOT NULL DEFAULT '' COMMENT 'Reservation Number',
