  `ExBedQty` smallint(6) DEFAULT '0' COMMENT 'Extra Bed Qty',
  `RoomTpCd` varchar(5) DEFAULT '' COMMENT 'Room Type Code',
  `BedCd` varchar(5) DEFAULT '' COMMENT 'Bed Code',
  `SmkTp` tinyint(4) DEFAULT '1' COMMENT 'Smoking Room Flag',
  `RoomNo` varchar(6) DEFAULT '' COMMENT 'Room Number',
  `RateTp` tinyint(4) DEFAULT NULL COMMENT 'Rate Type',
  `RateCtg` varchar(1) DEFAULT '' COMMENT 'Rate Category',
  `RateCurrCd` varchar(5) DEFAULT '' COMMENT 'Rate Currency Code',
  `RateCd` varchar(10) DEFAULT '' COMMENT 'Rate Code',
  `RateAmt` decimal(10,0) DEFAULT '0' COMMENT 'Rate Amount',
  `RateUpdtFl` varchar(1) DEFAULT '' COMMENT 'Rate Update Flag',
  `ExBedAmt` decimal(10,0) DEFAULT '0' COMMENT 'Extra Bed Amount',
  `Comission` decimal(10,0) DEFAULT '0' COMMENT 'Comission',
  `PymtMthd` varchar(5) DEFAULT '' COMMENT 'Payment Method',
  `PymtIns` varchar(100) DEFAULT '' COMMENT 'Payment Instruction',
  `OutletLock` tinyint(1) DEFAULT '1' COMMENT 'Outlet Lock Flag',
  `PhoneLock` tinyint(1) DEFAULT '0' COMMENT 'Phone Lock Flag',
  `GrntTp` varchar(1) DEFAULT '' COMMENT 'Guarantee Flag',
  `GrntDt` date DEFAULT NULL COMMENT 'Guarantee Date',
  `VchNo` varchar(20) DEFAULT '' COMMENT 'Voucher Number',
  `TimeLimit` varchar(5) DEFAULT '' COMMENT 'Time Limit',
