  `DpPaid` decimal(10,0) DEFAULT '0' COMMENT 'Deposit Paid',
  `CompCd` varchar(10) DEFAULT '' COMMENT 'Company Code',
  `CompDesc` varchar(50) DEFAULT '' COMMENT 'Company Description',
  `RsvSt` varchar(1) DEFAULT '' COMMENT 'Reservation Status',
  `MktSegCd` varchar(5) DEFAULT NULL COMMENT 'Market Segment Code',
  `Sob1Cd` varchar(5) DEFAULT NULL COMMENT 'SOB 1 Code',
  `Sob2Cd` varchar(5) DEFAULT NULL COMMENT 'SOB 2 Code',
  `PovCd` varchar(5) DEFAULT NULL COMMENT 'Purpose Of Visit Code',
  `IdType` varchar(5) DEFAULT NULL COMMENT 'ID Type',
  `IdNo` varchar(25) DEFAULT NULL COMMENT 'ID Number',
  `NatCd` varchar(5) DEFAULT NULL COMMENT 'Nationality Code',
  `Address` varchar(500) DEFAULT NULL COMMENT 'Address',
  `City` varchar(50) DEFAULT NULL COMMENT 'City',
  `Phone1` varchar(50) DEFAULT NULL COMMENT 'Phone 1',
  `EmailAddr1` varchar(50) DEFAULT NULL COMMENT 'Email Address',
  `WorkComp` varchar(25) DEFAULT NULL COMMENT 'Work Company',
  `BirthDt` date DEFAULT NULL COMMENT 'Birth Date',
  `BirthPlc` varchar(15) DEFAULT NULL COMMENT 'Birth Place',
  `RlgnCd` varchar(10) DEFAULT NULL COMMENT 'Religion Code',
  `BookerCd` varchar(10) DEFAULT NULL COMMENT 'Booker Code',
  `BookerNo` varchar(20) DEFAULT NULL COMMENT 'Booker Number',
  `Phone` varchar(50) DEFAULT NULL COMMENT 'Phone Number',
  `SlsCd` varchar(10) DEFAULT NULL COMMENT 'Salesman Code',
  `HistoryTp` varchar(1) DEFAULT NULL COMMENT 'History Type',
  `EArrDtl` varchar(50) DEFAULT NULL COMMENT 'Expected Arrival Detail',
  `EArrTm` datetime DEFAULT NULL COMMENT 'Expected Arrival Time',
  `EArrTrans` tinyint(1) DEFAULT NULL COMMENT 'Expected Arrival Transfer',
  `EDeptDtl` varchar(50) DEFAULT NULL COMMENT 'Expected Departure Detail',
  `EDeptTm` datetime DEFAULT NULL COMMENT 'Expected Departure Time',
  `EDeptTrans` tinyint(1) DEFAULT NULL COMMENT 'Expected Departure Transfer',
  `Remark` varchar(50) DEFAULT NULL COMMENT 'Remark',
  `CreateDt` date DEFAULT NULL COMMENT 'Created Date',
