  `CreateUser` varchar(30) DEFAULT NULL COMMENT 'Created By',
  `CiDt` date DEFAULT NULL COMMENT 'Check In Date',
  `CiTm` varchar(8) DEFAULT NULL COMMENT 'Check In Time',
  `CiUser` varchar(30) DEFAULT NULL COMMENT 'Check In By',
  `UpdateDt` date DEFAULT NULL COMMENT 'Updated Date',
  `UpdateTm` datetime DEFAULT NULL COMMENT 'Updated Time',
  `UpdateUser` varchar(30) DEFAULT NULL COMMENT 'Updated By',
  `CoDt` date DEFAULT NULL COMMENT 'Check Out Date',
  `CoTm` char(8) DEFAULT NULL COMMENT 'Check Out Time',
  `CoUser` varchar(30) DEFAULT NULL COMMENT 'Check Out By',
  `CanStDt` date DEFAULT NULL COMMENT 'Cancel Date',
