  `CanStRsn` varchar(50) DEFAULT NULL COMMENT 'Cancel Reason',
  `Notes` varchar(200) DEFAULT NULL COMMENT 'Notes',
  `Locked` tinyint(1) DEFAULT NULL COMMENT 'Locked',
  `DNDFl` tinyint(1) DEFAULT NULL COMMENT 'Dont Disturb ',
