  `GrpTp` varchar(20) DEFAULT '' COMMENT 'Group Type',
  `GrpPax` int(5) DEFAULT NULL COMMENT 'Estimate Group Pax',
  `EstSls` decimal(10,0) DEFAULT '0' COMMENT 'Estimate Sales',
  `FolioNo` varchar(20) DEFAULT '' COMMENT 'Folio Number',
